INSERT INTO `pooja` VALUES (1,' satyanarayan pooja ','The Satyanarayan Puja is a religious worship of the Hindu god Vishnu. Satya means truth and narayana means, The highest being so Satyanarayan means The highest being who is an embodiment of Truth. Vrat or Puja means a religious vow, religious observance, or obligation','uploads/pooja/12680sta3.jpg,uploads/pooja/32181sat2.jpg,uploads/pooja/74064sat.jpg','2500','1200',1,'2020-03-23 11:07:40'),(3,'Sunderkaand','Sundara Kaanda , is the fifth book in the Hindu epic, the Ramayana. The original Sundara Kanda is in Sanskrit and was composed by Valmiki, who was the first to scripturally record the Ramayana. Sundara Kanda is the only chapter of the Ramayana in which the hero is not Rama, but rather Hanuman. The work depicts the adventures of Hanuman and his selflessness, strength, and devotion to Rama are emphasized in the text. Hanuman was fondly called Sundara by his mother Anjani and Sage Valmiki chose this name over others as the Sundara Kanda is about Hanuman\'s journey to Lanka.','uploads/pooja/67707sunderkand.jpg','2000','1000',1,'2020-03-23 11:06:47'),(4,'Navdurga Pooja','Durga Puja , also called Durgotsava , is an annual Hindu festival originating in the Indian subcontinent which reveres and pays homage to the Hindu goddess, Durga. It is particularly popular in the Indian states of West Bengal, Assam, Bihar, Tripura, and Odisha, the country of Bangladesh, and the diaspora from this region, and also in Nepal, where it is celebrated as Dashain. The festival is observed in the Indian calendar month of Ashwin, which corresponds to the months of SeptemberOctober in the Gregorian calendar,and is a ten-day festival, of which the last five are of significance.The puja is performed in homes and in the public, the latter featuring temporary stage and structural decorations (known as pandals). The festival is also marked by scripture recitations, performance arts, revelry, gift giving, family visits, feasting, and public processions. Durga puja is an important festival in the Shaktism tradition of Hinduism.','uploads/pooja/51215navdurga.jpg','2800','1500',1,'2020-03-23 11:10:57'),(5,'Ganesh Sthapna','Ganesh Chaturthi , also known as Vinayaka Chaturthi , is a Hindu festival celebrating the arrival of Ganesha to earth from Kailash Parvat with his mother goddess Parvati/Gauri. The festival is marked with the installation of Ganesha clay idols privately in homes, or publicly on elaborate pandals (temporary stages). Observations include chanting of Vedic hymns and Hindu texts such as, prayers and brata (fasting).[3] Offerings and prasadam from the daily prayers, that are distributed from the pandal to the community, include sweets such as modaka as it is believed to be a favourite of Lord Ganesh. The festival ends on the tenth day after start, when the idol is carried in a public procession with music and group chanting, then immersed in a nearby body of water such as a river or sea. In Mumbai alone, around 150,000 statues are immersed annually.[6] Thereafter the clay idol dissolves and Ganesha is believed to return to Mount Kailash to Parvati and Shiva.\r\n\r\n','uploads/pooja/55336Lalbaugh_Ganesha.jpg','5000','4000',1,'2020-03-23 10:59:46'),(6,'Shop Opening','Shop Opening Pooja','uploads/pooja/11516icon.png','1600','1100',1,'2020-05-03 17:04:24'),(8,'Mundan','Mundan Sanskar pooja','uploads/pooja/23834Mundan-Sanskaar.jpg','2000','1500',1,'2020-06-06 10:31:02');
