INSERT INTO `product` VALUES (1,1,1,'Fruit','burger',50,'Kapoor is used to cure everything','uploads/product/95707burger.jpg',1,'2020-04-30 07:15:36',1,'Piece','3'),(2,1,4,'Sport','Cricket',2000,'Cricket is a bat-and-ball game played between two teams of eleven players on a field at the centre of which is a 20-metre (22-yard) pitch with a wicket at each end, each comprising two bails balanced on three stumps. The batting side scores runs by striking the ball bowled at the wicket with the bat, while the bowling and fielding side tries to prevent this and dismiss each player (so they are \"out\"). Means of dismissal include being bowled, when the ball hits the stumps and dislodges the bails, and by the fielding side catching the ball after it is hit by the bat, but before it hits the ground. When ten players have been dismissed, the innings ends and the teams swap roles. The game is adjudicated by two umpires, aided by a third umpire and match referee in international matches. They communicate with two off-field scorers who record the match\'s statistical information.','uploads/product/69783cricket.jpg',1,'2020-04-30 07:15:36',4,'Kg','3'),(3,0,1,'','Banana',80,'A banana is an edible fruit  botanically a berry[1][2]  produced by several kinds of large herbaceous flowering plants in the genus Musa.[3] In some countries, bananas used for cooking may be called \"plantains\", distinguishing them from dessert bananas. The fruit is variable in size, color, and firmness, but is usually elongated and curved, with soft flesh rich in starch covered with a rind, which may be green, yellow, red, purple, or brown when ripe. The fruits grow in clusters hanging from the top of the plant. Almost all modern edible seedless (parthenocarp) bananas come from two wild species  Musa acuminata and Musa balbisiana. The scientific names of most cultivated bananas are Musa acuminata, Musa balbisiana, and Musa  paradisiaca for the hybrid Musa acuminata  M. balbisiana, depending on their genomic constitution. The old scientific name for this hybrid, Musa sapie','uploads/product/32688banana.jpg',1,'2020-04-30 07:15:36',0,'','3'),(4,0,3,'','Onion',30,'he onion (Allium cepa L., from Latin cepa \"onion\"), also known as the bulb onion or common onion, is a vegetable that is the most widely cultivated species of the genus Allium. Its close relatives include the garlic, shallot, leek, chive,[2] and Chinese onion.[3]\r\n\r\nThis genus also contains several other species variously referred to as onions and cultivated for food, such as the Japanese bunching onion (Allium fistulosum), the tree onion (A. proliferum), and the Canada onion (Allium canadense). The name \"wild onion\" is applied to a number of Allium species, but A. cepa is exclusively known from cultivation. Its ancestral wild original form is not known, although escapes from cultivation have become established in some regions.[4] The onion is most frequently a biennial or a perennial plant, but is usually treated as an annual and harvested in its first growing season.\r\n\r\nThe onion plant has a fan of hollow, bluish-green leaves and its bulb at t','uploads/product/48556onion.jpg',1,'2020-04-30 07:15:36',0,'','3'),(5,0,5,'','product 1',10,'product Brad','uploads/product/48022bradpitt.jpg',1,'2020-04-30 07:15:36',0,'','3'),(6,0,0,'','teiiu',0,'','uploads/product/983520200419_193718.jpg',1,'2020-04-30 07:15:36',0,'','3'),(7,0,0,'','amarjyouti',0,'','uploads/product/4009IMG_20200419_155348_418.jpg',1,'2020-04-30 07:15:36',0,'','3'),(8,0,0,'','testt',0,'','uploads/product/683320200420_135319.jpg',1,'2020-04-30 07:15:36',0,'','3'),(12,1,1,'Fruit','hello',123,'1587378361341','uploads/product/408620200420_143346.jpg',0,'2020-04-30 07:15:36',2,'Kg','3'),(13,8,2,'VENDER','product 2',200,'','',1,'2020-04-30 07:15:36',34,'123','3'),(14,1,1,'Fruit','hlkk',236,'1587379020547','',0,'2020-04-30 07:15:36',1,'Gram','3'),(15,1,2,'Samagri','bxbxbdh',258,'1587379160063','',0,'2020-04-30 07:15:36',4,'Gram','3'),(16,1,2,'Sa